import logo from './logo.svg';
import './App.css';
import {Home} from './pages/home/home';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Home></Home>
        <div>
  <Button
    color="primary"
    onClick={function noRefCheck(){}}
  >
    Open
  </Button>
  <Offcanvas
    scrollable
    toggle={function noRefCheck(){}}
  >
    <OffcanvasHeader toggle={function noRefCheck(){}}>
      Offcanvas
    </OffcanvasHeader>
    <OffcanvasBody>
      <strong>
        This is the Offcanvas body.
      </strong>
    </OffcanvasBody>
  </Offcanvas>
</div>
      </header>
    </div>
  );
}

export default App;
